import React from 'react';
import ChildComponent from './ChildComponent';

function ParentComponent() {
  const name = "John";
  const age = 25;

  return (
    <div>
      <h2>Parent Component</h2>
      <ChildComponent name={name} age={age} />
    </div>
  );
}

export default ParentComponent;
